INSERT INTO `hotels_table` VALUES (4,'Гостевой дом \"Татьяна\" - старая',3,'Кабардинка, ул. Новороссийская 6','огороженная, благоустроенная (зеленые газоны, клумбы, летняя терраса с мангалом, подогреваемый открытый бассейн) Wi-Fi-интернет, паркинг.','современное 4-х этажное здание на 30 номеров','городской, оборудованный, галечный, платный или бесплатный по выбору (5-7 минут ходьбы)',1,16,'холодная и горячая постоянно (бойлер).','на первом этаже расположена большая современная кухня - столовая, оснащенная всем необходимым для самостоятельного приготовления пищи. В шаговой доступности столовые.','Гостевой дом «Татьяна» идеальный вариант для семейного отдыха, большая благоустроенная закрытая территория с бассейном , кухня, комфортабельные номера. Расположена в спокойном районе курортного поселка Кабардинка, до центра поселка 8-10 минут ходьбы.','проверьте наличие паспорта перед выездом на отдых, дополнительные услуги оплачиваются туристами по месту отдыха (питание, экскурсии и т. д.). В гостевом доме при открытых окнах возможно попадание насекомых в номерах. В случае аварии на подстанции возможны перебои с водой и электричеством. Работа бассейна регламентируется администрацией , нарушения правил приведет к штрафу. Родители должны следить за детьми и не оставлять их одних около бассейна. Расселением туристов по номерам занимается администрация. Время заселения (выселения) зависит от времени прибытия (убытия) и регламентируется руководителем тур. группы и администрацией пансионата. Туристы, прибывшие на автобусе, уведомляются о времени ожидания перед заселением (2-3 часа) для уборки номера. Туристы, закончившие свой отдых, должны освободить номера по требованию администрации к моменту приезда автобус. От гостевого дома до набережной около 5-7 минут',0,1),(5,'Гостевой дом «Акрополь» - старая',3,'пос. Кабардинка, Кабардинский пер. д. 8','Большая, благоустроенная. огороженная, благоустроенная, летняя терраса с мангалом, подогреваемый открытый бассейн, детская площадка, паркинг.','3-х этажных корпус на 40-60 человек.','городской, оборудованный, галечный, платный или бесплатный по выбору (10-12 минут ходьбы).',1,12,'Холодная и горячая постоянно (бойлер).','столовая с домашней кухней, уютной атмосферой, кипяток на каждом этаже, стоимость трех разового питания:800-1000руб(стоимость может измениться).','Условия проживания и отдыха в этом гостевом доме , отвечают требованиям самых взыскательных туристов. Номера оснащены современной стильной мебелью, в холлах - мраморная плитка. Отель расположен в 5-7 минутах ходьбы от аллеи с реликтовыми соснами, выходящей на набережную.','Примечание: проверьте наличие паспорта перед выездом на отдых, дополнительные услуги оплачиваются туристами по месту отдыха (питание, экскурсии и т. д.). В гостевом доме при открытых окнах возможно попадание насекомых в номера, из некоторых окон вид на соседние здания в том числе не достроенные. Работа бассейна регламентируется администрацией , нарушения правил приведет к штрафу. Родители должны следить за детьми и не оставлять их одних около бассейна.  В случае аварии на подстанции возможны перебои с водой и электричеством. Расселением туристов по номерам занимается администрация. Время заселения (выселения) зависит от времени прибытия (убытия) и регламентируется руководителем тур. группы и администрацией пансионата. Туристы, прибывшие на автобусе, уведомляются о времени ожидания перед заселением (2-3 часа) для уборки номера. Туристы, закончившие свой отдых, должны освободить номера по требованию администрации к моменту приезда автобус. От гостевого дома  до набережной около 10-12 минут',0,1),(6,'Отельный комплекс «АВАЛОН» - старая',4,'Отельный комплекс «АВАЛОН»','огороженная, благоустроенная - зеленые газоны, клумбы, открытый бассейн, детская площадка, места для отдыха с мангалом и со столиками, паркинг.','два современных корпуса , на 50 -60 мест. Номера : 2-х местные с балконом и без, 3-х местные  на первом  и цокольном этаже без балкона, 4х местные люкс 2-4й этаж( 4й этаж мансардный, скошенные потолки ). Некоторые  номера «смотрят» на соседнее здание.','собственный, оборудованный, песчаный, входит в стоимость проживания (10-12 минут ходьбы), первых 5-7 минут дорога проходит по району частной застройки.',1,31,'холодная и горячая постоянно (бойлер).','кафе-столовая, где по желанию можно вкусно позавтракать, пообедать или поужинать. Обед + ужин –по желанию, 800-1000 рос.руб с человека.','Отельный комплекс АВАЛОН расположен в пляжном пригороде Анапы – курортном поселке Джемете. Широкие песчаные пляжи, знаменитые дюны, развитая туристическая инфраструктура (кафе, бары, рестораны, магазины, аквапарк, дельфинарий, океанариум и лунапарк) ежегодно привлекают тысячи туристов.','проверьте наличие паспорта перед выездом на отдых, дополнительные услуги оплачиваются туристами по месту отдыха (питание, экскурсии и т. д.).При заселении оплачивается страховой залог в размере 2000 RUB, при выезде возвращается. При открытых окнах возможно попадание насекомых в номерах. Работа бассейна регламентируется админ., нарушения правил приведет к штрафу. Родители должны следить за детьми и не оставлять их одних около бассейна. В случае аварии на подстанции возможны перебои с водой и электричеством. Отельный комплекс «АВАЛОН» располагается в новом районе Джемете из некоторых номеров вид может быть на не достроенные здание. Расселением туристов по номерам занимается админ. Время заселения (выселения) зависит от времени прибытия (убытия) и регламентируется руководителем тур. группы и админ. пансионата. Туристы, прибывшие на автобусе, уведомляются о времени ожидания перед заселением (2-3 часа) для уборки номера. Туристы, закончившие свой отдых, обязаны освободить номера по просьбе администрации.',0,1),(7,'Гостевой дом \"Татьяна\"',3,'Кабардинка, ул. Новороссийская 6','огороженная, благоустроенная (зеленые газоны, клумбы, летняя терраса с мангалом, подогреваемый открытый бассейн) Wi-Fi-интернет, паркинг.','современное 4-х этажное здание на 30 номеров. Номера: 2